import './Other.scss';

const Other = () => {
  return (
    <Background pageClassName="background-images-other">
      <Header />
      <h1>Other</h1>
      {/* Ajoutez le contenu spécifique à la page ici */}
      <Footer />
    </Background>
  );
};

export default Other;
